import React from 'react';
import './components.css';

export const Navbar = () => (
  <nav>
    <img class="printer-logo" src="/printer.jpg" alt="Printer Logo" />
    <ul>
      <li><a href="#home">Home</a></li>
      <li><a href="#catalog">Catalog</a></li>
      <li><a href="#cart">Cart</a></li>
    </ul>
  </nav>
);
